def COLOR_RGB(r, g, b):
    return ((r & 0x1F) | (((g) & 0x3F) << 5) | (((b) & 0x1F) << 11))

def p2c(p):
    r = (p >> 16) & 0xff;
    g = (p >> 8) & 0xff;
    b = (p >> 0) & 0xff;
    b = (b * 249 + 1014) >> 11;
    g = (g * 243 + 505) >> 10;
    r = (r * 249 + 1014) >> 11;
    return COLOR_RGB(r, g, b);

